window.bookSummaryJSON = "<p><b>With Brian Tracy’s <i>The Psychology of Selling</i> you will learn how to program yourself for success.</b> </p> <p>How would you like to triple your income in just 12 months? </p> <p>That’s the incredible promise legendary sales mastermind Brian Tracy makes in this “graduate level” sales training program <i>The Psychology of Selling</i> - one of the best, most comprehensive programs of its kind ever produced. </p> <p>“Selling is an inner game,” Brian states, “and the difference between top performers and average ones is not as great as you might think. Top performers just do certain things a little bit better each day.” In these 12 sessions you’ll learn the field-tested techniques that will give <i>you</i> that critical edge, so you can blow the roof off your closing rate and your commissions. In this landmark program, you’ll discover: </p> <p></p> <ul> <li>Why the top 20 percent of salespeople earn 16 times the average of the rest. </li> <li>The 10 characteristics of superior salespeople. </li> <li>The psychology of buying. </li> <li>How to break a prospect’s preoccupation. </li> <li>Why goal setting is a key to sales success. </li> <li>Six ways to increase effectiveness. </li> <li>How to deal with a prospect’s nine most common objections. </li> <li>The Law of Six and how it can help you. </li> <li>And so much more! </li> </ul> <p></p> <p><b>PLEASE NOTE: When you purchase this title, the accompanying reference material will be available in your Library section along with the audio.</b></p>"; 
